const MiniHeader = (prop) => {

    return(
        <div className="miniHeader">
            <h2>{prop.text}</h2>
        </div>
        
    )
}

const Header = () => {

    return(
        <>
            <header className={"header"}>
            <ul>
                <a><li>Movies</li></a>
                <a><li>TV Shows</li></a>
                <a><li>People</li></a>
                <a><li>News</li></a>

            </ul>
        </header>
        <MiniHeader></MiniHeader>
        </>
    )
}

export default Header
